import {
    Card,
    Checkbox,
    IconButton,
    List,
    ListItem,
    ListItemIcon,
    ListItemText,
} from "@material-ui/core";
import { Clear, Create } from "@material-ui/icons";
function Todo() {
    return (
        <Card>
            <List
                sx={{
                    width: 200,
                    height: 230,
                    bgcolor: "background.paper",
                    overflow: "auto",
                }}
                dense
                component="div"
                role="list"
            >
                <ListItem role="listitem" button>
                    <ListItemIcon>
                        <Checkbox tabIndex={-1} disableRipple />
                    </ListItemIcon>

                    <ListItemText>todo test</ListItemText>


                    <IconButton color="secondary" aria-label="Delete">
                        <Clear fontSize="small" />
                    </IconButton>
                </ListItem>
            </List>
        </Card>
    );
}

export default Todo;
